import switchComponent from "./App"

class ControllerButton extends React.Component 
{



  handleClick = () => {
  	let self = this;
    console.log("test button clicked");
    self.props.toggleMap("Map");
  }

  render() {
    return (
      <button onClick={this.handleClick}>
        Switch
      </button>
    );
  }
}

export default ControllerButton;
